document.addEventListener("DOMContentLoaded",(function(){const e=$("#articles");$("#news").on("change",(function(){let n=$(this).val();$.ajax({method:"GET",url:`https://api.nytimes.com/svc/topstories/v2/${n}.json?api-key=AWYIBsLV3ssb38vug8gBUciGOuyLBhEN`,dataType:"json"}).done((function(n){console.log(n);const t=n.results.filter((function(e){if(void 0!==e.multimedia[4])return!0})).slice(0,12);$.each(t,(function(n,t){e.append(`\n                    <article class="each-article" style="background-image:url(${t.multimedia[4].url})">\n                        <a href="${t.url}"></a>\n                        <div class="title"><h2>${t.title}</h2>\n                        <p>${t.abstract}</p></div>\n                    </article>\n                    `)}))})).fail((function(){$(".user-name").append("Sorry there was an error.")}))}))}));